													html: address,
													icon:	{
															image:"http://labs.google.com/ridefinder/images/mm_20_white.png",
															iconsize: [26, 46],
															iconanchor: [12,46]
															}
													}]
						});
						jQuery( "span.FYN_viewmap" ).each(function( index ) {
